import  Authorization  from '../Authorization/pages/Authorization';
import  Registration  from '../Registration/pages/Registration';
import  ResetPassword  from '../ResetPassword/pages/ResetPassword';
import  TodoList  from '../TodoList/pages/TodoList';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import React, { useState } from 'react';
import { ITodo } from '../interface';
import { InjectedArrayProps } from 'redux-form';

interface ITodoProps{
    todoList: ITodo[];
    onAddTask(newTask : ITodo) : void;
}
const Router : React.FC<ITodoProps> = ({todoList, props : any} ) => {

    const handleSubmit = (values: any) => {
        window.alert(JSON.stringify(values));
    }

    return(
        <BrowserRouter>
            <Switch>
                <Route exact path = "/todo">
                    {<Authorization {...props}/>}
                </Route>
                <Route path = "/registration">
                    {<Registration {...props} /> }
                </Route>
                <Route path = "/reset">
                    {<ResetPassword onSubmit = {handleSubmit} {...props} />}
                </Route>
                <Route path = "/">
                    {<TodoList todoList = {todoList} {...props} />}
                </Route> 
            </Switch>
        </BrowserRouter>
    )
}

export default Router
